//Optimal solution I found (did not make). This essentially works by mapping the chars at the same indexes to each other.
// If you have to make an individual char to more than 1 of the other char, then the strings are not isometric
    bool isIsomorphic(string s, string t) {
        if(s.length() != t.length()) return false;

        // arrays to store mapping.
        vector<int> mapS(256, -1); //Initalized vect with 256 elems and val of -1 for each, soley built around the int values for each char, as there are 256 chars
        vector<int> mapT(256, -1);

        for(int i = 0; i < s.length(); i++){ //Traversing all chars in each letters, as both string have the same amount of chars if they reach here
            char chS = s[i];
            char chT = t[i];

            // If current characters already mapped (entails value is not the default val)
        if (mapS[chS] != -1 || mapT[chT] != -1) {
            // If the to be mapped value is not equal to the already mapped char val, the strings are not isometric
            if (mapS[chS] != chT || mapT[chT] != chS) {
                return false; // conflict in mapping
            }
        } else {
            // Create new mapping, mapped by the chars int vals, which represents what you'd swap each char to in order to make them the other word (string s -> t or t -> s).
            mapS[chS] = chT;
            mapT[chT] = chS;
        }
    }

    return true;
        }

